//rcc tab
import React, { Component } from "react";
import "./Components.css";

class NavbarComponent extends Component {
  render() {
    return (
      <div class="navbarContainer">
        <div>
          <a class="nav-link itemText home-link" aria-current="page" href="#">
            ANASAYFA
          </a>
        </div>

        <div>
          <a class="nav-link itemText home-link" href="#">
            PROFİL
          </a>
        </div>
        <div>
          <a class="nav-link itemText home-link" href="#">
            ÜRÜNLER
          </a>
        </div>
        <div>
          <a class="nav-link itemText home-link" href="#">
            İLETİŞİM
          </a>
        </div>
      </div>
    );
  }
}
export default NavbarComponent;
